      content: >2-
                       [head=2]Протокол эвакуации экипажа
                        с помощью шаттла ОБР[/head]
        [bold]

        Эвакуация экипажа с использованием шаттла Отряда Быстрого Реагирования (ОБР) возможна при следующих условиях:

        [/bold]

        [italic]
         [bullet]Станция не может функционировать, пребывание на станции опасно;

         [bullet]Разрешена эвакуация всего персонала на шаттле ОБР. Вызывается экстренный эвакуационный шаттл. Станция может функционировать, но пребывание на ней временно опасно;

         [bullet]Разрешено дождаться устранения угрозы на шаттле ОБР. После ликвидации опасности весь персонал должен покинуть шаттл. Станция может функционировать и пребывание на ней безопасно:

         [bullet]Стыковка/нахождение на шаттле ОБР без прямого приказа от Офицера Специальных Операций или разрешения от состава ОБР запрещена. В случае военного положения нахождение на шаттле без приказа может пресекаться летальной силой без предупреждения. Важно

         [bullet]Протокол эвакуации персонала может быть изменён в зависимости от ситуации вышестоящим руководством под их ответственность.
